import React from 'react';

function App() {
  return (
    <main className="space-y-12 px-6 py-8 max-w-3xl mx-auto">
      <section className="text-center space-y-4">
        <h1 className="text-3xl font-bold">UX Prototypes That Convert — In Just One Week</h1>
        <p className="text-lg">I'm Dylan Pagillo — a UX engineer (ex-Cisco) helping startups simplify complexity and ship faster.</p>
        <a href="#contact" className="inline-block mt-4 px-6 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 transition">Book a Free Discovery Call</a>
      </section>
    </main>
  );
}

export default App;
